			</FooterLeft>
			<CopyrightContainer>
				Copyright &copy; 2020 Shree Ramkrishna OilMills | All Rights Reserved
			</CopyrightContainer>
			<CopyrightContainer>Privacy Policy | Return & Refund Policy</CopyrightContainer>
			<FooterRight></FooterRight>
		</FooterContainer>
	);
}

export default Footer;
